import React from "react";
import { StyleSheet, Text, Button, View } from 'react-native';

const Startup = () => {    
    return (
        <View>
            <Text>GymBooking</Text>
            <Text>Supérate día a día</Text>   


            <Button title="Iniciar Sesión"/>
            <Button title="Registrarse"/>
        </View>
    );
};

export default Startup;
